
public class ExceptionHandling {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=10;
		int b=1;
		
		try {
		int div=a/b;
		
		System.out.println(div);
		}
		catch(Exception e)
		{
			System.out.println(e);
		}
		
		System.out.println("ended");
		
		
		
		
		
		

	}

}
